export default (latLngLit, country)=>{
    console.log(latLngLit)
    return fetch(`http://localhost:3001`, {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify({
            latitude: latLngLit.lat,
            longitude: latLngLit.lng,
            country: country
        })
    })
    .then(response=>response.json())
}
